import React from "react";
import { Link } from "react-router-dom";
import { Divider } from "antd";
import {InstagramOutlined} from '@ant-design/icons'
import {FacebookOutlined} from '@ant-design/icons'
import Logoo from '../../assets/images/logo2.png';

function Footerr(){
    return(
        <div>
            <div className="logo2">
            <Link to='/'>
            <img src={Logoo} alt="Logoo" className="logoo" /> 
            </Link>
            </div> 
            <Divider />
            <div>
                <h2>Հետևե՛ք մեզ նաև այլ հարթակներում</h2>
                <Link to="https://www.instagram.com/" className="icon"><InstagramOutlined /></Link> 
                <Link to="https://www.facebook.com/" className="icon"><FacebookOutlined /></Link> 
            </div>
            <p style={{marginBottom:'-10px'}}>The official tourism website of Armenia</p> 
            <p> WebTravel © 2024 </p>
        </div>
    )
}

export default Footerr
